import React from 'react'
import Aux from '../../hoc/Aux';

const layout = ( props ) => {
return (
        <Aux>
        <div>side bar toolbar </div>
        <main>
        {props.childern}
        </main>
        </Aux>
        )
            
}

export default layout;
